import React, {Component, useState} from 'react';
import {Link} from 'react-router-dom';
import '../../css/styles.css';
import Logo from './Logo.svg';
//import ContactUsLink from './ContactUsLink';
//import FavListLink from './FavListLink';
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";


import {
  

  NavBtn,
  NavBtnLink
} from '../../css/navbarElements';

import { Navbar, NavbarToggler, Collapse, NavItem, Nav } from "reactstrap";

class NavbarUser extends Component  {

  

	render() { 
    const { user } = this.props.auth;
    
    const [isOpen, setIsOpen] = useState(false);

  const toggleHandler = () => {
    setIsOpen(!isOpen);
  }
  
    return(
    <div>

      <Navbar light expand="md">
      <a className="navbar-brand" >
      <img src={Logo} height="55" class="d-inline-block align-left"
     			alt="spartan logo" />
           <Link className="Logo " to="/">
             SpiritWorld      
        </Link>
        </a>
        <NavbarToggler onClick={toggleHandler}></NavbarToggler>
        <Collapse isOpen={isOpen} navbar>
          <Nav navbar className="ml-auto">
            <NavItem>
              <Link className="nav-link " to="/">
                Favorite List
              </Link>
            </NavItem>
            <NavItem>
              <Link className="nav-link" to="/add">
                Profile
              </Link>
            </NavItem>
            <NavItem>
              <Link className="nav-link" to="/add">
                Contact Us
              </Link>
            </NavItem>
            <NavBtn>
          
        </NavBtn>
          </Nav>
        </Collapse>
      </Navbar>
    </div>
    
    
	
    );
}
};

NavbarUser.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(
  mapStateToProps,
  { logoutUser }
)(NavbarUser);
